import React from 'react'
import { Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';

import Info from './Info.js'

const Town = (props) => {
    // const wind = props.wind;
    return (
        <Col xs={2} ><Link to={`/${props.title}`}>{props.title} </Link>
            <Info wind={props.wind}/> 
        </Col>
    )
}

export default Town
